import mc from "./main.module.scss";
import { useSelector } from "react-redux";
//components//
import PlayersMenu from "../players-menu/PlayersMenu";

const Main = () => {
  const {
    title,
    release,
    directors,
    actors,
    image,
    type,
    synopsis,
    trailer,
    error,
    errorColor,
  } = useSelector((store) => {
    return store.adminsCinemaReducer;
  });

  return (
    <div className={mc.container}>
      <PlayersMenu />
    </div>
  );
};

export default Main;
